import Topbar from "./components/topbar/Topbar.jsx";
import Home from "./components/home/Home";
import Contact from "./components/contact/Contact";
import Intro from "./components/intro/Intro"

function App() {
  return (
    <div className="App">
      <Topbar/>
      <div className='sections'>
        <Home/>
        <Contact/>
        <Intro/>

      </div>
    </div>
  );
}

export default App;
